import * as React from 'react';
import { 
  AppBar, 
  Toolbar, 
  Typography, 
  IconButton,
  Button, 
  FormControl, 
  FormControlLabel, 
  Checkbox, 
  InputLabel, 
  OutlinedInput, 
  TextField, 
  InputAdornment, 
  Link, 
  Box
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import AccountCircle from '@mui/icons-material/AccountCircle';
import Visibility from '@mui/icons-material/Visibility';
import VisibilityOff from '@mui/icons-material/VisibilityOff';
import MenuIcon from '@mui/icons-material/Menu';

function CustomEmailField() {
  return (
    <TextField
      id="input-with-icon-textfield"
      label="Email"
      name="email"
      type="email"
      size="small"
      required
      fullWidth
      InputProps={{
        startAdornment: (
          <InputAdornment position="start">
            <AccountCircle fontSize="inherit" />
          </InputAdornment>
        ),
      }}
      variant="outlined"
    />
  );
}

function CustomPasswordField() {
  const [showPassword, setShowPassword] = React.useState(false);

  const handleClickShowPassword = () => setShowPassword((show) => !show);

  const handleMouseDownPassword = (event) => {
    event.preventDefault();
  };

  return (
    <FormControl sx={{ my: 2 }} fullWidth variant="outlined">
      <InputLabel size="small" htmlFor="outlined-adornment-password">
        Mot de Passe
      </InputLabel>
      <OutlinedInput
        id="outlined-adornment-password"
        type={showPassword ? 'text' : 'password'}
        name="password"
        size="small"
        endAdornment={
          <InputAdornment position="end">
            <IconButton
              aria-label="toggle password visibility"
              onClick={handleClickShowPassword}
              onMouseDown={handleMouseDownPassword}
              edge="end"
              size="small"
            >
              {showPassword ? <VisibilityOff fontSize="inherit" /> : <Visibility fontSize="inherit" />}
            </IconButton>
          </InputAdornment>
        }
        label="Mot de Passe"
      />
    </FormControl>
  );
}

function CreerUtilisateur() {
  const navigate = useNavigate();
  const [message, setMessage] = React.useState('');

  const handleSignUp = async (event) => {
    event.preventDefault();
    const formData = new FormData(event.currentTarget);
    const email = formData.get('email');
    const password = formData.get('password');
    const tandc = formData.get('tandc');

    if (!tandc) {
      setMessage('Vous devez accepter les termes et conditions');
      return;
    }

    try {
      const response = await fetch('http://localhost:3000/api/users', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ email, password }),
      });

      if (response.ok) {
        setMessage('Utilisateur créé avec succès');
        navigate('/Utilisateurs');
      } else {
        setMessage('Erreur lors de la création de l\'utilisateur');
      }
    } catch (error) {
      console.error('Erreur:', error);
      setMessage('Erreur lors de la création de l\'utilisateur');
    }
  };

  return (
    <div>
      <AppBar position="static" color="primary">
        <Toolbar>
          <IconButton edge="start" color="inherit" aria-label="menu">
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" color="inherit">
            Créer un compte
          </Typography>
        </Toolbar>
      </AppBar>
      <Box component="form" onSubmit={handleSignUp} sx={{ mt: 3, mx: 'auto', maxWidth: 400, p: 2, borderRadius: 1, boxShadow: 3 }}>
        <Typography variant="h5" component="h1" gutterBottom>
          Créer un compte
        </Typography>
        <CustomEmailField />
        <CustomPasswordField />
        <FormControlLabel
          control={<Checkbox name="tandc" required />}
          label="J'accepte les termes et conditions"
        />
        <Button type="submit" variant="contained" color="primary" fullWidth sx={{ mt: 2 }}>
          S'inscrire
        </Button>
        {message && <Typography variant="body2" color="error" sx={{ mt: 2 }}>{message}</Typography>}
        <Link href="/Authentification" variant="body2" sx={{ display: 'block', textAlign: 'center', mt: 2 }}>
          Déjà un compte ? Connectez-vous
        </Link>
      </Box>
    </div>
  );
}

export default CreerUtilisateur;
